import React, { Component } from "react";

import HomeStyles from "../components/styles/HomeStyles";
import SidebarNav from "../components/SidebarNav";
import NewsFeed from "../components/NewsFeed";

class Home extends Component {
  render() {
    return (
      <HomeStyles>
        <SidebarNav />
        <div>
          <h1>Home Page</h1>
        </div>
      </HomeStyles>
    );
  }
}

export default Home;
